import * as React from 'react';
import BottomNavigation from '@mui/material/BottomNavigation';
import BottomNavigationAction from '@mui/material/BottomNavigationAction';
import FolderIcon from '@mui/icons-material/Folder';
import RestoreIcon from '@mui/icons-material/Restore';
import FavoriteIcon from '@mui/icons-material/Favorite';
import LocationOnIcon from '@mui/icons-material/LocationOn';
import RenderItem from './RenderItem';
import { BarChart, HourglassEmpty } from '@mui/icons-material';

export default function LabelBottomNavigation() {
  const [value, setValue] = React.useState('WprldCloud');

  const handleChange = (event: React.SyntheticEvent, newValue: string) => {
    setValue(newValue);
  };

  return (
    <div>
   <RenderItem valnav={value}> </RenderItem>
    <BottomNavigation sx={{ width: 500 }} value={value} onChange={handleChange}>
      <BottomNavigationAction
        label="World Cloud"
        value="Word Cloud"
        icon={<CloudQueue />}
      />
      <BottomNavigationAction
        label="Criteria Plotter"
        value="Criteria Plotter"
        icon={<BarChart />}
      />
      <BottomNavigationAction
        label="Time Spent"
        value="Time Spent"
        icon={<HourglassEmpty />}
      />
      <BottomNavigationAction label="Written Reviews" value="Written Reviews" icon={<Article />} />
    </BottomNavigation>
    </div>
  );
}
